package ai.vital.service.vertx.handlerimport java.util.Map;import ai.vital.vitalservice.exception.VitalServiceExceptionimport ai.vital.vitalservice.exception.VitalServiceUnimplementedExceptionimport ai.vital.vitalservice.query.ResultList;
import ai.vital.vitalsigns.model.VitalAppimport ai.vital.vitalsigns.model.VitalOrganization/** * A custom callFunction handler, it should register with *  */
interface CallFunctionHandler extends ICallFunctionHandler {
	public final static String VERTX_REGISTER_HANDLER = "vertx-register-handler"		public final static String VERTX_UNREGISTER_HANDLER = "vertx-unregister-handler"		public final static String VERTX_LIST_HANDLERS = "vertx-list-handlers"			public final static String JS_REGISTER_STREAM_HANDLER = 'js-register-stream-handler'		public final static String JS_UNREGISTER_STREAM_HANDLER = 'js-unregister-stream-handler'		public final static String JS_LIST_STREAM_HANDLERS = 'js-list-stream-handlers'		public final static String VERTX_SEND_TO_STREAM = 'vertx-send-to-stream'		public final static String VERTX_STREAM_SUBSCRIBE = 'vertx-stream-subscribe'		public final static String VERTX_STREAM_UNSUBSCRIBE = 'vertx-stream-unsubscribe'		public final static String VERTX_STREAM_LIST_SESSION_SUBSCRIPTIONS = 'vertx-stream-list-session-subscriptions'		public final static String VERTX_STREAM_LIST_STREAM_SUBSCRIBERS = 'vertx-stream-list-stream-subscribers'			public final static List<String> allHandlers = Collections.unmodifiableList([		VERTX_REGISTER_HANDLER,		VERTX_UNREGISTER_HANDLER,		VERTX_LIST_HANDLERS,		JS_REGISTER_STREAM_HANDLER,		JS_UNREGISTER_STREAM_HANDLER,		JS_LIST_STREAM_HANDLERS,		VERTX_SEND_TO_STREAM,		VERTX_STREAM_SUBSCRIBE,		VERTX_STREAM_UNSUBSCRIBE,		VERTX_STREAM_LIST_SESSION_SUBSCRIPTIONS,		VERTX_STREAM_LIST_STREAM_SUBSCRIBERS	]) 		public ResultList callFunction(VitalOrganization organization, VitalApp app, String function, Map<String, Object> params, Map<String, Object> sessionParams) throws VitalServiceUnimplementedException, VitalServiceException		
}
